import React from 'react';
import Unconnect from "./Image/unconnect.png"
import "./Right.css";

class Rop1 extends React.Component {
	getROption1 = () => {
		let arr = [];
		for(let i=0;i<3;i++){
			arr.push(
				<tr>
					<td><img src={Unconnect}/></td>
					<td><img src={Unconnect}/></td>
					<td><img src={Unconnect}/></td>
				</tr>
			);
		}
		return arr;
	}
  render() {
    return (
		<div className="aa">
		  <table style={{width:'98px',height:'130px'}}>
			<tbody>{this.getROption1()}</tbody>
		  </table>
		</div>
    )
  }
}
export default Rop1;
